import './App.css';
import Post from "./Post"
import Header from "./Header"
import { Route } from "react-router-dom"

function App() {
  return (

        <Route path="/" element={
          <main>
            <Header />
            <Post />
            <Post />
            <Post />
          </main>
        } />

  );
}

export default App;
